import styled from 'styled-components';

export const DivFlex = styled.div `
    display: flex;
    justify-content: center;
    align-itens: center;
`
export const ImgExtra = styled.img`
    max-height: 150px;
    max-width: 90;
    margin: 0 auto 30px;
    width: 100%;
`
export const TitleCont = styled.h1`
    float: right;
`
export const TextCont = styled.p`
    float: right;
`
